        "ID": "1473425",
        "Image": "\/gstatic\/games\/tomhorn\/315\/blackbeards_quest.jpg",
        "Url": "987\/VSlotBBQ_TNP",
        "Name": {"en": "Blackbeard's Quest"},
        "Description": {
            "en": "Help Blackbeard find the treasure buried on this adventure island. With nine win lines and five reels, Pirate Blackbeard will appear as a wild card to substitute for any of the other symbols (except Scatter symbols) and grant you more wins. This game comes with hidden jewels like Free Spins.",
            "cs": "Pomozte Černovousovi na tomto ostrově plném dobrodružství najít ukrytý poklad. V této hře s devíti výherními řadami a pěti válci je symbol piráta Černovouse zástupným symbolem jakéhokoliv jiného symbolu (kromě tzv. symbolu scatter) a zaručí vám vyšší výhry. Jsou zde jsou ukryty klenoty, díky nimž můžete získat například zatočení zdarma.",
            "de": "Helfen Sie Blackbeard den Schatz zu finden, der auf der Abenteuerinsel vergraben ist. Mit neun Gewinnzeilen und fünf Walzen erscheint Pirat Blackbeard als Wild-Karte, die jedes andere Symbol (außer Scatter-Symbole) ersetzt und Ihnen mehr Gewinne bringt kann. Dieses Spiel besitzt verborgene Schätze wie Gratis-Spins.",
            "es": "Ayuda a Barbanegra a encontrar el tesoro enterrado en esta isla de aventura. Con nueve líneas de pago y cinco carretes, el Pirata Barbanegra aparecerá como comodín para reemplazar a otros símbolos (excepto Scatters) y ayudarte a ganar. Este juego viene cargado de gemas escondidas como Jugadas Gratis.",
            "it": "Aiuta Barbanera a trovare il tesoro nascosto su questa isola avventurosa. Con nove linee di vincita e cinque rulli, il pirata Barbanera apparirà come carta wild per sostituire uno qualsiasi degli altri simboli (tranne i simboli Scatter) e assegnarti ulteriori vincite. In questo gioco ci sono gioielli nascosti, ad esempio i Partite Libere (Free Spins).",
            "lt": "Padėkite Juodabarzdžiui rasti lobį, paslėptą šioje nuotykių saloje. Šiame žaidime su devyniomis laimėjimo linijomis ir penkiais suktuvais piratas Juodabarzdis pasirodys kaip WILD simbolis, kuris pakeičia bet kuriuos kitus simbolius (išskyrus SCATTER simbolius) ir padeda laimėti daugiau. Šiame žaidime yra paslėptų perliukų, pvz., nemokamų sukimų.",
            "hu": "Segítsen Feketeszakállnak megkeresni a kincset ezen a kalandos szigeten. A kilenc nyerősoros és öt tárcsás gépen Feketeszakáll kalóz a joker, aki (a scatter szimbólumok kivételével) bármely másik szimbólumot helyettesíthet, és még több nyereményt garantál. Ebben a játékban rejtett jutalmakat, például ingyenes pörgetést is kaphat.",
            "pl": "Pomóż Czarnobrodemu znaleźć skarb zakopany na tej wyspie przygód. Gra ma dziewięć linii wygranej i pięć bębnów. Czarnobrody pirat pojawia się jako dzika karta, która zastępuje dowolne inne symbole (za wyjątkiem symboli rozproszonych) i zapewnia wyższe wygrane. W tej grze można znaleźć ukryte klejnoty, takie jak darmowe spiny.",
            "pt": "Ajude o Barba Negra a encontrar o tesouro enterrado nesta ilha de aventuras. Com nove linhas de jogo e cinco cilindros, o Pirata Barba Negra aparecerá como Wild para substituir qualquer um dos outros símbolos (exceto símbolos Scatter) e conceder mais prémios. Este jogo inclui jóias escondidas, tais como Jogadas Grátis.",
            "sk": "Pomôžte Černovous na tomto ostrove plnom dobrodružstva nájsť ukrytý poklad. V tejto hre s deviatimi výhernými líniami a piatimi valcami je symbol piráta Čiernofúza zástupným symbolom akéhokoľvek iného symbolu (okrem tzv. Symbolu scatter) a zaručí vám vyššie výhry. Sú tu sú ukryté klenoty, vďaka ktorým môžete získať napríklad zatočení zadarmo.",
            "ru": "Помогите Черной Бороде найти сокровища, закопанные на этом острове приключений. В игре используется девять выигрышных линий и пять барабанов, «Пират Черная Борода» является «диким» символом, который может заменять любой другой из символов (кроме «разбросанных» символов) и обеспечивает больший выигрыш. В игре имеются скрытые драгоценности, например «Бесплатные обороты».",
            "zh-hans": "帮助黑胡子找到这个岛上埋藏的宝藏。有了5轴9中奖线，黑胡子海盗富豪作为万能代替其他符号(除了散射符号) 可以给您更多胜利。这个游戏有隐藏珠宝像是自由旋转。"
        },
