            "it": "Le Meraviglie del Mondo Antico sono presenti su cinque rulli rotanti su 15 linee di vincita. Il Gioco Bonus e i Partite Libere accenderanno gli animi dei giocatori fornendo grandi opportunità di vincita. Il simbolo del faro è un simbolo Wild.",
            "lt": "Gėrėkitės senovės pasaulio stebuklais penkiuose suktuvuose su 15 laimėjimo linijų. BONUS žaidimas ir nemokami sukimai suteikia žaidėjams ypatingo džiaugsmo ir galimybių daug laimėti. Švyturio paveikslėlis yra WILD simbolis.",
            "hu": "Csodálja meg az Ősi világ csodáit ezen az öt forgó tárcsás és 15 nyerősoros játékgépen. Bónusz menetei és ingyenes pörgetései különös izgalmakban és nagy nyerési lehetőségekben részesítik a játékosokat. A világítótorony szimbólum joker.",
            "pl": "Podziwiaj cuda starożytnego świata w grze z pięcioma obracającymi się bębnami i 15 liniami wygranej. Gra dodatkowa i darmowe spiny zapewniają graczom dodatkowe emocje i szanse wielkich wygranych. Symbol latarni morskiej jest wieloznaczny.",
            "pt": "Admire as Maravilhas do Velho Mundo com cinco cilindros giratórios e 15 linhas de jogo. O Jogo de Bónus e as Jogadas Grátis proporcionarão aos jogadores emoção especial e grandes oportunidades de ganhar. O símbolo de Farol é Wild.",
