            "en": "Join the journey to a remote island and find the lost treasure. Whenever a pirate appears on the horizon, you will get 20 Free Spins. Treasure Island has 5 spinning reels with 15 win lines. The game features Wild and Scatter symbols.",
            "cs": "Vydejte se na plavbu na vzdálený ostrov a nalezněte ztracený poklad. Kdykoliv se na horizontu objeví pirát, obdržíte 20  zatočení zdarma. Hra Treasure Island má 5  válců a  15  výherních řad. Ve hře na vás čekají zástupné symboly a symboly scatter.",
