            "it": "Parti in viaggio per un'isola remota e trova il tesoro perduto. Ogni volta che un pirata appare all'orizzonte ottieni 20 Partite Libere. Treasure Island ha 5 rulli rotanti su 15 linee di vincita. Il gioco presenta simboli Wild e Scatter.",
