            "pt": "Os ovos postos por dragões são a chave para vencer neste jogo. As suas 9 linhas de jogo são o ambiente perfeito para que o Wild Winged Dragon mostre as suas asas e dobre as suas vitórias dado que substitue os outros símbolos. Os Scatter Eggs ativam um Jogo de Bónus em que colecionar três ovos do mesmo dragão premia-o com 10 a 30 Jogadas Grátis com um multiplicador de 3x-5x.",
