            "hu": "A Don Juan’s Peppers Farm keresett pörgetős játékokat készít. A Nap Wild szimbóluma segít megszerezned a legjobb kombinációkat. 3 vagy több Csípős, vörös csilipaprika akár 10-25 ingyenes pörgetést ad, és az ilyen landolásért a maradék ingyenes pörgetésekre érvényes Sticky Scatter Wilddá váló ingyenes pörgetés a jutalmad, amitől még édesebb a nyerés.",
