            "pt": "Don Juan’s Peppers Ranch produz os mais procurados picantes do sul do México. O Sol brilhará como símbolo Wild para o ajudar a obter as mais quentes combinações. 3 ou mais Pimentões Vermelhos desencadeiam de 10 a 25 Jogadas Grátis e sempre que apareçam durante uma jogada proporcionam-lhe uma Jogada Grátis extra e transformam-se em símbolos Sticky Scatter Wild durante as restantes Jogadas Grátis, tornando o seu prémio ainda mais picante.",
