        "Name": {"en": "Black Mummy"},
        "Description": {
            "en": "Solve the mystery of the Black Mummy and learn what happens in the afterlife when you earn a lot of money by playing this 5-reels, 5-fixed win lines video slot game. The Black Mummy symbol is a Wild card and a win multiplier at the same time.",
            "cs": "Vyřešte záhadu černé mumie a zjistěte, jak bude vypadat posmrtný život, zatímco si vyděláte hodně peněz hraním této 5válcové videohry s  5  výherními řadami. Symbol černé mumie je zástupný symbol a zároveň násobí vaši výhru.",
            "de": "Lüften Sie das Geheimnis der Schwarzen Mumie und erfahren Sie, was im Leben danach passiert, wenn Sie diesen Video-Slot mit 5 Walzen 5 festen Gewinnzeilen spielen und eine Menge Geld gewinnen. Das Symbol Schwarze Mumie ist eine Wild-Karte und ein Gewinnmultiplikator zugleich.",
            "es": "Resuelve el misterio de la Momia Negra y entérate de lo que pasa en el más allá cuando ganas mucho dinero jugando a este juego de 5 carretes y 5 líneas de pago. El símbolo de la Momia Negra es Wild (un comodín) y un multiplicador de ganancias al mismo tiempo.",
            "it": "Risolvi il mistero di Black Mummy e scopri cosa succede nell'aldilà quando guadagni molti soldi giocando con questa video slot con 5 rulli e 5 linee di vincita fisse. Il simbolo della mummia nera è una carta Wild e un moltiplicatore allo stesso tempo.",
            "lt": "Išnarpliokite Juodosios mumijos paslaptį, sužinokite, kas nutinka pomirtiniame gyvenime, ir gaukite daug pinigų žaisdami šį 5 suktuvų ir 5 pastovių laimėjimo linijų lošimo automatų vaizdo žaidimą. Juodosios mumijos paveikslėlis yra WILD simbolis ir laimėjimo daugiklis tuo pačiu metu.",
            "hu": "Oldja meg a Fekete Múmia rejtélyét, és fedezze fel, mi történik a túlvilágon! Nyerjen sok pénzt ezzel az 5 tárcsás, 5 fix nyerősoros video-játékgéppel. A fekete múmia szimbólum egyszerre joker és nyereménytöbbszöröző.",
            "pl": "Rozwiąż tajemnicę czarnej mumii i dowiedz się, co może stać się w zaświatach, kiedy wygrasz dużo pieniędzy, grając na automacie wideo z pięcioma bębnami i pięcioma stałymi liniami wygranej. Symbol czarnej mumii to dzika karta, a zarazem mnożnik wygranej.",
            "pt": "Resolva o mistério da Múmia Negra e fique a saber o que acontece na vida depois da morte ganhando bastante dinheiro ao jogar este videojogo de slots com 5 cilindros e 5 linhas de jogo fixas. O símbolo de Múmia Negra é Wild e, em simultâneo, um multiplicador de prémios.",
            "sk": "Vyriešte záhadu čierne múmie a zistite, ako bude vyzerať posmrtný život, zatiaľ čo si zarobíte veľa peňazí hraním tejto 5válcové videohry s 5 výhernými líniami. Symbol čiernej múmie je zástupný symbol a zároveň násobí vašu výhru.",
            "ru": "Разгадайте тайну Черной Мумии и узнайте, что произойдет в следующей жизни, когда вы выиграете много денег в эту видео слот-игру с 5 барабанами и 5 фиксированными выигрышными линиями. Символ черной мумии является «диким» и одновременно является коэффициентом, на который умножается выигрыш.",
            "zh-hans": "解开黑色木乃伊的秘密。并且看看您玩过这个5转轮向5嬴奖线的老虎机游戏以后会有什么结果。黑色木乃伊是一张万能牌，并且是一张可以同时赢很多的牌。"
        },
