        "ID": "1470590",
        "Image": "\/gstatic\/games\/tomhorn\/315\/geishas_fan_tnp.jpg",
        "Url": "987\/VSGeisha_TNP",
        "Name": {"en": "Geisha's Fan"},
        "Description": {
            "en": "Ethereal light is falling through sakura flowers on subtle Geisha's face, half-hidden under her Umbrella. She is languidly waving her Fan, a Wild Symbol that teases you with bigger wins. When you see 3 or more Hand Fans scattered on the reels, get ready to win big as they trigger 10 retriggerable Free Spins with special expanding symbol for more winning combinations.",
            "cs": "Na jemnou gejšinu tvář napůl skrytou pod deštníkem dopadá přes květiny sakura éterické světlo. Apaticky mává svým vějířem Wild Symbolem, který vás láká na větší výhry. Když uvidíte na kotoučích 3 nebo více roztroušených Ručních vějířů, pak se připravte na velké výhry, protože symboly aktivují 10 znovu aktivovatelných zatočení zdarma spolu se speciálním prodlužovacím symbolem pro ještě více výherních kombinací.",
            "de": "Ethereal light is falling through sakura flowers on subtle Geisha's face, half-hidden under her Umbrella. She is languidly waving her Fan, a Wild Symbol that teases you with bigger wins. When you see 3 or more Hand Fans scattered on the reels, get ready to win big as they trigger 10 retriggerable Free Spins with special expanding symbol for more winning combinations.",
            "es": "La luz etérea atraviesa las flores de sakura y llega a la cara suave de la Geisha, que está medio oculta por el paraguas. Mueve lánguidamente su abanico, un símbolo wild que te tienta con mayores ganancias. Cuando veas 3 o más abanicos dispersos en los tambores, prepárate para ganar a lo grande, ya que provoca 10 jugadas gratis que se pueden volver a activar con el símbolo especial de la expansión para conseguir más combinaciones ganadoras.",
            "it": "Dei raggi eterei di luce passano attraverso i fiori di ciliegio giapponese e riflettono sul volto delicato di una geisha, in parte nascosto dietro al suo ombrellino. La donna continua a sventolare languidamente il suo ventaglio, un simbolo jolly che ti stuzzicherà con le grandi vincite a cui è associato. Quando vedrai apparire sui rulli 3 o più ventagli, ti dovrai preparare a vincere grandi somme di denaro, grazie a 10 partite libere riattivabili con un simbolo speciale espandibile, che ti darà l'opportunità di trovare ancora più combinazioni vincenti.",
            "lt": "Eterio šviesa krenta nuo sakuros žiedų ant švelnaus Geišos veido, kurio pusė paslėpta po jos skėčiu. Ji vangiai mojuoja savo vėduokle, tai simbolis „Wild\", vilioja jus didesniais laimėjimais. Kai pamatysite tris vėduokles išsiblaškiusias po būgną, pasiruoškite dideliam laimėjimui, nes jie duoda 10 pakartojamų nemokamų sukimų su specialiais besiplečiančiais simboliai, suteikiančiais dar daugiau laiminčių kombinacijas.",
            "hu": "Éteri fény hull a cseresznyevirágokon keresztül a gésa finom arcára, amelyet félig elrejt az esernyője. Egykedvűen legyez a legyezőjével, ami egy nagy nyereményekkel kecsegtető Wild szimbólum. Amikor 3 vagy több kézi legyezőt látsz elterülve az orsókon, készülj fel a nagy nyereményre, mivel ezek 10 újra kiváltható ingyenes pörgetést váltanak ki egy speciálisan táguló szimbólummal a még több nyerőkombináció érdekében.",
            "pl": "Eteryczne światło pada poprzez kwiaty sakura na delikatną twarz gejszy, do połowy ukrytą pod jej parasolem. Leniwie macha swoim wachlarzem, dzikim symbolem, który kusi Cie większymi wygranymi. Kiedy zobaczysz 3 lub więcej rozpostartych wachlarzy, przygotuj się na dużą wygraną, ponieważ poruszą one spust 10 darmowych spinów ze specjalnym symbolem rozbudowy, dla jeszcze większej liczby wygrywających kombinacji.",
            "pt": "Uma luz etérea cai através das flores de sakura sobre o subtil rosto da Gueixa, meio oculto sob o seu guarda-chuva. Ela acena languidamente o seu leque, um Símbolo Wild que o desafia com grandes prémios. Quando vir 3 ou mais Leques de Mão sobre as rodas, prepare-se para ganhar em grande à medida que eles desencadeiam 10 Jogadas Grátis capazes de serem novamente disparadas com símbolos especiais que se expandem para mais combinações vencedoras.",
            "sk": "Éterické svetlo dopadá cez kvety sakury na delikátnu tvár gejše, napoly skrytú pod dáždnikom. Ležérne sa ovieva svojím vejárom, symbolom Wild, ktorý ťa láka ešte väčšími výhrami. Keď uvidíš aspoň tri vejáre na valcoch, priprav sa na veľkú výhru, pretože to znamená 10 opätovne sa spúšťajúcich zatočení zadarmo so špeciálnym rozširujúcim symbolom pre viac výherných kombinácií.",
            "ru": "Небесный свет падает через цветки сакуры на утонченное лицо гейши, наполовину скрытое под ее зонтиком. Она лениво махает веером, который является символом Wild и манит вас к более крупным выигрышам. Когда вы увидите 3 или более вееров, разбросанных на барабанах, будьте готовы выиграть по-крупному, поскольку они запускают 10 бесплатных спинов с возможностью перезапуска и особым расширяющимся символом, позволяющим получить еще больше выигрышных комбинаций.",
            "zh-hans": "神愈圣光透过樱花，洒落在艺妓半掩于纸伞的精细面孔之上。她懒洋洋地挥动着纸扇，这是以更大的胜利来挑逗你的Wild符号。当你看到3个或更多手扇散落于卷盘时，就要准备赢取大奖了，因为它们会以逐步扩大的特殊符号，触发10个可再次触发的自由旋转，从而获取更多的得分组合。"
        },
