        "ID": "1141466",
        "Image": "\/gstatic\/games\/tomhorn\/315\/aces_and_faces_poker_4_hand.jpg",
        "Url": "987\/VPAAFFP",
        "Name": {"en": "Aces And Faces Poker 4 Hand"},
        "Description": {
            "en": "Aces and Faces 4 Hand Poker is played between you and the dealer. You play four hands at same the time and each hand uses its own standard 52-card deck. This Poker game highly rewards combinations of 4 Aces or 4 face cards – Kings, Queens or Jacks.",
            "cs": "V pokerové hře s názvem Aces and Faces  4  Hand Poker se hrají současně  4  hry a hrajete vy a dealer. Všechny čtyři hry se hrají současně a při každé se používá standardní balíček karet s  52  kartami. Při tomto typu pokeru je nejvyšší odměna za kombinace  4  es nebo čtyř obrázkových karet – to znamená král, královna nebo kluk.",
            "de": "Der Aces and Faces 4-Hand-Poker wird zwischen Ihnen und dem Geber gespielt. Sie spielen vier Hände gleichzeitig und jede Hand verwendet ihr eigenes Standard-Kartenspiel mit 52 Karten. Bei diesem Pokerspiel erzielen Kombinationen mit 4 Assen oder 4 Bildkarten – Könige, Damen und Buben – hohe Gewinne.",
            "es": "Aces and Faces 4 Hand Poker se juega entre usted y la casa, en cuatro manos simultáneamente. Cada mano usa su propia baraja estándar de 52 cartas. Este póker paga premios altísimos por combinaciones de 4 Aces o 4 pintas – Reyes, Damas o Jotas.",
            "it": "Aces and Faces 4 Hand Poker si gioca contro il banco. Il giocatore gioca quattro mani contemporaneamente e per ogni mano si usa un mazzo regolare da 52 carte. Questo gioco di Poker premia le combinazioni di 4 assi o 4 figure (Re, Regine o Jack).",
            "lt": "„Aces and Faces 4 Hand Poker“ žaidžiamas tarp jūsų ir dalytojo. Žaidžiami keturi dalijimai tuo pačiu metu ir kiekvienam dalijimui naudojama atskira standartinė 52 kortų malka. Šiame pokerio žaidime daugiausia laimima už 4 tūzų arba 4 kortų su veidais – karalių, karalienių arba valetų – kombinacijas.",
            "hu": "A négy leosztásos Ászok és alakok pókert Ön és az osztó játssza. Egyszerre négy leosztással játszik, és mindegyik leosztás külön standard 52 lapos kártyapakliból történik. Ez a pókerjáték nagyobb arányban jutalmazza a 4 ászból vagy 4 figurás kártyából – királyból, dámából vagy bubiból – álló kombinációkat.",
            "pl": "Poker Aces and Faces 4 Hand jest rozgrywany między graczem a rozdającym. Rozgrywane są cztery układy jednocześnie, a każdy układ używa własnej standardowej talii z 52 kartami. Ten poker oferuje najwyższe nagrody za układy czterech asów lub czterech figur — króli, dam lub waletów.",
            "pt": "O Aces and Faces 4 Hand Poker é jogado entre o utilizador e o dealer. Joga quatro mãos em simultâneo e cada uma destas utiliza o próprio baralho normal de 52 cartas. Este jogo de póquer possibilita grandes prémios para as combinações de 4 ases ou 4 figuras: Reis, Damas ou Valetes.",
            "sk": "V pokrovej hre s názvom Aces and Faces 4 Hand Poker sa hrajú súčasne 4 hry a hráte vy a dealer. Všetky štyri hry sa hrajú súčasne a pri každej sa používa štandardný balíček kariet s 52 kartami. Pri tomto type pokru je najvyššia odmena za kombinácie 4 es alebo štyroch obrázkových kariet - to znamená kráľ, kráľovná alebo chlapec.",
            "ru": "В игре покер «Тузы и картинки» на четыре руки игрок играет против дилера. Игра происходит в четыре руки одновременно и для каждой руки используется отдельная стандартная колода из 52 карт. В этой разновидности покера самыми выигрышными являются комбинации из 4 тузов или 4 «картинок» — короли, дамы или вальты.",
            "zh-hans": "A牌和花牌 4手扑克在您和庄家之间展开。您将同时玩4手扑克，每一手都使用一副标准52张牌。这种游戏模式组合四张A或者花牌– K，Q，或者J就能得到超高的奖励。"
        },
