        "Image": "\/gstatic\/games\/tomhorn\/315\/jacks_or_better_poker.jpg",
        "Url": "987\/VPJOB",
        "Name": {"en": "Jacks Or Better Poker"},
        "Description": {
            "en": "Jacks or Better Poker is a standard video poker played between you and the dealer with a standard 52-card deck, without the joker. 5 cards are dealt in the first round. You choose which cards you want to hold to form the strongest combination. The cards you do not hold will be substituted by new ones from the same deck.",
            "cs": "Jacks or Better Poker je klasická videohra, kterou hrajete vy a dealer. Ke hře se používá standardní balíček 52  karet bez žolíka. V prvním kole se rozdá 5  karet. Vy si poté vyberete, které karty si chcete nechat, abyste mohli vytvořit tu nejlepší kombinaci. Karty, které si nebudete nechávat, budou nahrazeny novými kartami z téhož balíčku.",
            "de": "Der Jacks or Better-Poker ist ein Standard-Videopoker, der zwischen Ihnen und dem Geber mit einem Standard-Kartenspiel von 52 Karten ohne Joker gespielt wird. In der ersten Runde werden 5 Karten gegeben. Sie wählen, welche Karten Sie halten wollen, um die stärkste Kombination zu bilden. Die Karten, die Sie nicht halten, werden durch neue Karten desselben Kartenspiels ersetzt.",
            "es": "Jacks or Better Poker es un juego de video póker estándar que se juega contra la casa y con una baraja de 52 cartas sin el Joker. En la primera ronda se reparten 5 cartas. Debe escoger las cartas que quiere retener para formar una mano ganadora. Las cartas que no quiera serán substituidas por cartas nuevas de la misma baraja.",
            "it": "Nel videopoker classico Jacks or Better Poker, il giocatore gioca contro il banco con un mazzo regolare da 52 carte, senza jolly. Durante il primo giro vengono distribuite 5 carte. Il giocatore sceglie quali tenere per formare la combinazione vincente. Quelle scartate verranno sostituite da carte nuove dello stesso mazzo.",
            "lt": "„Jacks or Better Poker“ yra standartinis vaizdo pokeris, žaidžiamas tarp jūsų ir dalytojo su standartine 52 kortų malka be džiokerio. Per pirmąjį etapą padalijamos 5 kortos. Jūs renkatės, kurias kortas norite pasilikti, kad sudarytumėte stipriausią kombinaciją. Kortos, kurių nepasiliekate, bus pakeistos naujomis kortomis iš tos pačios malkos.",
            "hu": "A Bubi vagy nagyobb póker egy általános póker-videojáték, amelyet Ön és az osztó játszik normál 52 lapos paklival, a joker nélkül. Az első körben 5 lapot osztanak. Ön kiválasztja, hogy mely lapokat tartja meg a legnagyobb értékű kombináció kialakításához. A dobott lapok helyett újakat kap ugyanabból a pakliból.",
            "pl": "Poker Jacks or Better to standardowy poker wideo rozgrywany między graczem a rozdającym przy użyciu standardowej talii z 52 kartami bez dżokera. W pierwszej rundzie rozdawanych jest pięć kart. Możesz wybrać karty, które chcesz zatrzymać, aby utworzyć najsilniejszy układ. Odrzucone karty zostaną zastąpione nowymi kartami z tej samej talii.",
            "pt": "O Jacks or Better Poker é um videojogo de póquer normal, jogado entre o utilizador e o dealer com um baralho normal de 52 cartas, sem o joker. São distribuídas 5 cartas na primeira ronda. O utilizador escolhe as cartas que pretende manter para formar a combinação mais forte. As cartas que rejeitar serão substituídas por cartas novas do mesmo baralho.",
            "sk": "Jacks or Better Poker je klasická videohra, ktorú hráte vy a dealer. K hre sa používa štandardný balíček 52 kariet bez žolíka. V prvom kole sa rozdá 5 kariet. Vy si potom vyberiete, ktoré karty si chcete nechať, aby ste mohli vytvoriť tú najlepšiu kombináciu. Karty, ktoré si nebudete nechávať, budú nahradené novými kartami z toho istého balíčka.",
            "ru": "«Валеты и выше» представляет собой стандартный видеопокер, в котором игрок играет против дилера с использованием стандартной колоды из 52 карт без джокера. В первом раунде сдается 5 карт. Игрок выбирает карты, которые он хочет сохранить, чтобы получить самую сильную комбинацию. Остальные карты игрок меняет на новые из той же колоды.",
            "zh-hans": "对J及以上扑克是一种标准的扑克游戏，在您和庄家之间展开， 没有小丑牌。第一回合各发五张牌。您来决定留下哪些牌来形成最强的组合。 您没有留下的牌将被替换成这手牌里另外的某张。"
        },
