            "de": "Aces and Faces Poker wird mit einem Kartenspiel mit 52 Karten ohne Joker gespielt. Aces and Faces Poker ist ein Standard Video-Pokerspiel, das auf Jacks or Better basiert. Die höchsten Gewinne werden für Kombinationen mit 4 Assen oder Bildkarten – Könige, Damen und Buben – ausgezahlt.",
