            "it": "Aces and Faces Poker si gioca con un mazzo regolare da 52 carte senza Jolly. Aces and Faces Poker è un videopoker standard basato su Jacks or Better. I premi più alti vengono pagati per le combinazioni di 4 assi o figure (Re, Regine o Jack).",
            "lt": "Žaidimas „Aces and Faces Poker“ žaidžiamas su standartine 52 kortų malka be džiokerio. „Aces and Faces Poker“ yra standartinis pokerio vaizdo žaidimas, pagrįstas valetais arba geresnėmis kortomis. Daugiausia laimima už 4 tūzų arba kortų su veidais – karalių, karalienių arba valetų – kombinacijas.",
            "hu": "Az Ászok és alakok pókert a szokásos 52 lapos kártyapaklival, jokerek nélkül játsszák. Az Ászok és alakok póker általános póker-videojáték, amelynek alapja a Bubi vagy nagyobb játék. A legnagyobb jutalmat a 4 ászból vagy figurás kártyákból – királyból, dámából vagy bubiból – álló kombinációk fizetik.",
            "pl": "Poker Aces and Faces jest rozgrywany przy użyciu standardowej talii z 52 kartami bez dżokera. Poker Aces and Faces to standardowy poker wideo oparty na wariancie Jacks or Better. Najwyższe nagrody są wypłacane za układy czterech asów lub figur — króli, dam lub waletów.",
            "pt": "O Aces and Faces Poker é jogado com um baralho normal de 52 cartas, sem o Joker. O Aces and Faces Poker é um videojogo de póquer normal baseado em Valetes ou Melhor. Os maiores prémios são pagos para combinações de 4 ases ou figuras: Reis, Damas ou Valetes.",
            "sk": "Na hranie pokru s názvom Aces and Faces sa používa štandardný balíček s 52 kartami, ale bez žolíka. Poker Aces and Faces je klasický Videopoker, založený na princípoch hry Jacks or Better. Najvyššia odmena sa vypláca za kombinácia 4 es alebo obrázkových kariet s kráľom, kráľovnou alebo chalanom.",
