            "de": "Keno ist wegen seiner Einfachheit und der Chance, eine Menge Geld mit relativ kleinen Wetten zu gewinnen ein sehr beliebtes Spiel.  Wenn Sie gerne Nummern in einem Lotterieformat erraten, werden Sie Keno lieben. Keno verwendet einen Nummerntopf mir Nummern von 1 bis 80. In jeder Runde werden 20 Nummern gezogen.",
            "es": "Keno es un juego muy popular debido a su simplicidad y la oportunidad de ganar mucho dinero con apuestas relativamente bajas. Si te gusta acertar en sorteos de números como en la lotería, definitivamente disfrutarás el Keno. Keno se juega con números del 1 al 80 y en cada juego se extraen 20 balotas.",
            "it": "Keno è un gioco molto famoso grazie alla sua semplicità e alla possibilità di vincere molto scommettendo relativamente poco. Se ti piace indovinare i numeri della lotteria, Keno ti piacerà sicuramente. Keno usa schede e un bussolotto con i numeri da 1 a 80. Ad ogni giro vengono estratti 20 numeri.",
            "lt": "„Keno“ yra labai populiarus žaidimas, nes jis paprastas ir suteikia galimybę laimėti daug pinigų statant santykinai mažas sumas. Jei mėgstate spėlioti skaičius loterijos formatu, jums tikrai patiks „Keno“. „Keno“ naudojamos sritys ir skaičių indas su numeriais nuo 1 iki 80. Kiekvienu etapu traukiama 20 skaičių.",
            "hu": "A Kenó rendkívül népszerű játék, mivel egyszerű és viszonylag kis tétekkel is nagy nyereményekre ad esélyt. Ha szereti a lottószerű számtippelős játékokat, akkor biztosan élvezni fogja a kenót. A kenóban játékmezők vannak, a számkosár 1–80-ig tartalmazza a számokat. Minden körben 20 számot húznak.",
            "pl": "Keno jest bardzo popularną grą ze względu na swoją prostotę i możliwość wygrania dużych pieniędzy przy relatywnie niskich stawkach. Jeśli lubisz zgadywanie liczb w sposób przypominający loterię, z pewnością spodoba Ci się Keno. Gra Keno wykorzystuje przedziały i obszar z liczbami od 1 do 80. W każdej rundzie jest losowanych 20 liczb.",
            "pt": "O Keno é um jogo bastante popular devido à sua simplicidade e probabilidade de ganhar bastante dinheiro com apostas relativamente pequenas. Se gosta de adivinhar números no formato de lotaria, certamente gostará do Keno. No Keno são utilizados lugares e um pote de números, de 1 a 80. São extraídos 20 números em cada jogo.",
            "sk": "Keno je veľmi populárna hra vďaka svojej jednoduchosti a vďaka možnosti vyhrať veľa peňazí pri relatívne nízkych stávkach. Ak radi hádate vylosované čísla, určite si hru Keno obľúbite. Pri hre Keno sa používa hracie pole a losovacej osudia s číslami od 1 do 80. V každom kole je ťahané 20 čísiel.",
            "ru": "Кено является очень популярной игрой благодаря своей простоте и шансу выиграть много денег при относительно небольших ставках. Если вам нравится угадывать числа в формате лотереи, то вам обязательно понравится игра «Кено». В Кено используются ячейки и числовая панель с числами от 1 до 80. В каждом раунде разыгрывается 20 чисел.",
            "zh-hans": "基诺是一个非常流行的游戏，因为它的简单和用小赌注赢大钱的机会。如果您喜欢彩票式的猜数字格式，那么您一定会喜欢基诺。基诺使用游戏点和一个有从1-80数字的数字底池，每回合绘制出20个数字。"
