            "de": "Amerikanisches Roulette ist eines der beliebtesten Kasinospiele. Die Spieler (normalerweise bis zu 8) spielen gegen das Haus, das durch den Croupier (auch Geber genannt) repräsentiert wird, der das Rouletterad dreht und die Einsätze und Auszahlungen verwaltet. In den USA hat das Rad zwei Nullen und daher 38 Slots.",
