            "pt": "A Roleta é um dos jogos de casino favoritos. Até oito jogadores jogam contra a casa, representada pelo crupiê (também chamado o dealer), que faz girar a roleta e gere as apostas e os pagamentos. Nos E.U.A., a roleta tem dois Zeros e, portanto, 38 espaços.",
