            "hu": "Ússz a delfinekkel a lenyűgöző mélytengeri világba és gyűjtsd össze a kincset: az értékes gyöngyöket! A Wild Pearl (Vad Gyöngy) 9 nyertes sorral rendelkezik, melyben a Vad delfin megdupláz minden olyan nyereményt, ahol helyettesítésre kerül sor. Ezen felül a Gyöngyszórás 15 ingyenes pörgetést tartalmazó csomagot is aktivál, mely bónusz újra és újra aktiválható, 3x-os szorzóval.",
            "pl": "Płyń z delfinami prosto do olśniewającego głębokiego morza i kolekcjonuj skarb z cennych pereł. Dziki perłą mają 9 zwycięskich linii na których Dziki Delfin podwaja każdą wygraną, którą zastępuje, a symbol Scatter pereł uwalnia pakiet 15 Darmowych spinów. Przed uwolnieniem pakietu zostaje naniesiony mnożnik x3.",
            "pt": "Nade com Golfinhos no espetacular mar profundo e colecione um tesouro de pérolas preciosas. Selvagem Pérola tem 9 linhas de pago em que o Golfinho Selvagem dobra todas as vitórias em que entrar e as Pérolas Espalhadas libertam pacotes reativáveis de 15 Jogadas Grátis. Um multiplicador 3x é aplicado antes da reativação.",
            "sk": "Zaplávajte si s delfínmi v ohromujúcom hlbokom mori s delfínmi a zbierajte poklady v podobe vzácnych perál. Hra Wild Pearl obsahuje 9 výherných línií, na ktorých divoký symbol delfína zdvojnásobuje každú výhru, ktorú doplňuje a rozptylový („scatter“) symbol perál spúšťa opätovne spustiteľný balík 15 točení zdarma. Pred opätovným spustením sa zapne 3x násobenie.",
            "ru": "Плавайте с дельфинами и собирайте сокровища в виде драгоценных жемчужин. Игра «дикий жемчужина» располагает 9 выигрышными линиями. На них дикий символ «Дельфин» удваивает каждый выигрыш а символ разброса «Жемчужины» активирует перезапускаемые пакеты из 15 бесплатных вращений. При этом перед перезапуском применяется 3-кратный множитель.",
            "zh-hans": "和海豚一起游进深海，寻找珍贵的珍珠宝藏。野外珍珠有9条中奖线，而且万能海豚作为替代时的任何中奖所得都是双倍，并且散射珍珠可以释放出15次可重新激活的自由旋转。激活前还有3倍加成。"
