            "de": "In diesem Spiel überleben wie im Finanzzentrum New York nur jene, die bereit sind etwas zu riskieren das Auf und Ab des Aktienmarktes. Wall Street hat 5 Walzen und 15 Gewinnzeilen. Legen Sie das Telefon nicht auf, bevor Sie das Bonus-Spiel gewonnen und die Scatter-Gewinne erhalten haben. Das Broker-Symbol ist das Wild-Symbol.",
            "es": "En el centro financiero de Nueva York, como en este juego, solo los que estén dispuesto a tomar riesgos sobrevivirán las altas y bajas del mercado. Wall Street tiene 5 carretes giratorios y 15 líneas de pago. No cuelgues el teléfono hasta no haber ganado en el Juego de Bono y recibido ganancias Scatter. El símbolo del Corredor de bolsa es Wild.",
            "it": "Nel centro finanziario di New York, come in questo gioco, solo chi rischia sopravvive agli alti e bassi del mercato. Wall Street ha 5 rulli rotanti su 15 linee di vincita. Non agganciare il telefono finché non hai vinto nel Gioco Bonus e ricevuto le vincite Scatter. Il simbolo con il broker è un simbolo Wild.",
            "lt": "Niujorko finansų centre, kaip šiame žaidime, išgyvena tik tie, kurie rizikuoja greitai besikeičiančioje akcijų biržoje. Žaidime „Wall Street“ yra 5 suktuvai ir 15 laimėjimo linijų. Nepadėkite ragelio, kol nelaimėsite BONUS žaidimo ir negausite SCATTER laimėjimų. Brokerio paveikslėlis yra WILD simbolis.",
