            "pt": "No centro financeiro de Nova Iorque, tal como neste jogo, apenas aqueles dispostos a arriscar sobrevivem aos altos e baixos do mercado da bolsa. O Wall Street tem 5 cilindros giratórios e 15 linhas de jogo. Não desligue o telefone até ganhar no Jogo de Bónus e receber prémios de Scatter. O símbolo de Corretor é Wild.",
            "sk": "V newyorskom finančnom centre, rovnako ako v tejto hre, prežijú len tí, ktorí sú ochotní podstúpiť vzostupy a pády, ktoré sa viažu k stabilite na finančnom trhu. Hra Wall Street má 5 valcov a 15 výherných radov. Nevešajte telefón, kým ste nevyhrali niektorú z bonusových hier a získali výhru vďaka symbolu scatter. Symbol makléra je zástupný symbol.",
            "ru": "В финансовом центре Нью-Йорка, как и в этой игре, только те, кто готов пойти на риск, смогут пережить взлеты и падения на рынке акций. В игре «Уолл-стрит» используется 5 вращающихся барабана и 15 выигрышных линий. Не вешайте трубку, пока не выиграете в призовую игру и не получите выигрыш по «разбросанным» символам. Символ брокера является «диким».",
