            "hu": "A Vidámparkban soha véget nem érő szórakozás kezdődik. A Vidámparknak 5 forgó tárcsája és 9 nyerősora van a nagyobb nyerési esélyért. Van SCATTER szimbólum, az óriáskerék szimbólum pedig joker.",
