            "pt": "O divertimento sem fim começa no Luna Park. O Luna Park tem 5 cilindros giratórios com 9 linhas de jogo para maiores probabilidades de ganhar. Existe um símbolo SCATTER e o símbolo Roda Russa é Wild.",
            "sk": "Nikdy nekončiaci zábava začína v hre Luna Park. Hra Luna Park má 5 valcov a 9 výherných radov, ktoré vám zvyšujú šance na výhru. Čaká tu na vás symbol scatter a zástupný symbol v podobe ruského kolesa.",
            "ru": "Нескончаемое веселье начинается в Луна-парке. В игре «Луна-парк» имеется 5 вращающихся барабанов с 9 выигрышными линиями, которые повышают шансы на выигрыш. Имеется РАЗБРОСАННЫЙ символ, а символ русской рулетки является «диким».",
