        "Image": "\/gstatic\/games\/tomhorn\/315\/loch_ness_monster.jpg",
        "Url": "987\/VSlotLNM",
        "Name": {"en": "Loch Ness Monster"},
        "Description": {
            "en": "Believers and non-believers in the legend of the Loch Ness Monster alike will find themselves captivated by this game’s entertaining graphics, its engaging Bonus Games, and the extra rewards granted by Free Spins and a Scatter symbol that comes with its own multipliers. All this over five spinning reels and 25 win lines.",
            "cs": "Ať už věříte na existenci Lochnesské příšery nebo ne, zábavná grafika této hry vás uchvátí, stejně jako její okouzlující bonusové hry a zvláštní odměny, jako je zatočení zdarma a symbol scatter, který sám výhru ještě znásobí. To vše na pěti válcích a  25  výherních řadách.",
            "de": "Ob Sie an die Legende von Loch Ness glauben oder nicht, die unterhaltsamen Darstellungen dieses Spiels, seine ansprechenden Bonus-Spiele und die Extra-Gewinne der Gratis-Spins sowie das Scatter-Symbol mit eigenem Multiplikator werden Sie fesseln. Und das alles auf fünf Walzen und 25 Gewinnzeilen.",
            "es": "Tanto los creyentes en la leyenda del Monstruo del Lago Ness como los escépticos se sentirán cautivados por sus entretenidos gráficos, sus dos simpáticos Juegos de Bono y los premios extra que otorgan las Jugadas Gratis y un símbolo Scatter que viene con sus propios multiplicadores. Todo esto sobre 5 carretes con 25 líneas de pago.",
            "it": "Il mistero del mostro di Loch Ness affascinerà credenti e scettici grazie a alla divertente grafica di questo gioco, agli interessanti Giochi Bonus e ai premi extra assegnati dai Partite Libere e dal simbolo Scatter con i suoi moltiplicatori. Tutto questo in cinque rulli rotanti su 25 linee di vincita.",
            "lt": "Tikintieji ir netikintieji Lochneso pabaisos legenda bus įtraukti šio žaidimo smagios grafikos, jo įdomių papildomų žaidimų ir pridėtinių nemokamų sukimų bei SCATTER simbolio, kuris padaugina laimėjimus. Visa tai penkiuose suktuvuose ir 25 laimėjimo linijose.",
            "hu": "Akár hisz a Loch Ness-i szörny legendájában, akár ne, ennek a játéknak a szórakoztató grafikája, magával ragadó bónusz menetek, az ingyenes pörgetéssel és saját szorzószámokkal érkező scatter szimbólumok és megszerezhető extra jutalmak biztosan rabul fogják ejteni. Mindezt egy öt tárcsás és 25 nyerősoros játékgép nyújtja Önnek.",
            "pl": "Niezależnie od tego, czy wierzysz w potwora z Loch Ness, pozwól się wciągnąć zabawnej grafice tej gry z interesującymi grami dodatkowymi. Otrzymuj dodatkowe nagrody dzięki darmowym spinom. Rozproszony symbol zapewnia dodatkowe mnożniki wygranej. Gra ma pięć obracających się bębnów i 25 linii wygranej.",
            "pt": "Crentes e não-crentes na lenda do Monstro de Loch Ness e do género estarão motivados pelos gráficos fantásticos deste jogo, o seu envolvente Jogo de Bónus e os prémios extra oferecidos por Jogadas Grátis e um símbolo Scatter que vem com os seus próprios multiplicadores. Tudo isto ao longo de cinco cilindros giratórios e 25 linhas de jogo.",
            "sk": "Či už veríte na existenciu Lochnesská príšery alebo nie, zábavná grafika tejto hry vás uchváti, rovnako ako jej očarujúca bonusové hry a zvláštne odmeny, ako je zatočenie zadarmo a symbol scatter, ktorý sám výhru ešte znásobí. To všetko na piatich valcoch a 25 výherných radoch.",
            "ru": "Эта увлекательная игра захватит как тех, кто верит, так и тех, кто не верит в легенду о Лохнесском чудовище, своей привлекательными призовыми играми, а также дополнительными призами, дающие бесплатные обороты и «разбросанный символ», каждый из которых несет собственные коэффициенты. Вся игра проходит с использованием пяти вращающихся барабанов и 25 выигрышных линий.",
            "zh-hans": "无论信与不信尼斯湖水怪传说的人，都会被这个游戏有趣的画面，引人入胜的奖励游戏机制，自由旋转可以给予的额外奖励以及一个有自己加成的散射符号所吸引。这些都来自这个5转轮25中奖线的游戏。"
        },
