            "pl": "Gangsterzy powracają po więcej! Jeśli zbieranie płatności, potyczki z gangsterami lub spotkania z bossem to zbyt wiele dla Ciebie, możesz szybko zacząć zarabiać bez konieczności bijatyki na tym automacie wideo z pięcioma bębnami i 25 liniami wygranej. Można tu znaleźć także gry dodatkowe i wygrane rozproszone, a symbol walizki z pieniędzmi jest dziką kartą.",
            "pt": "Os gangsters regressaram. Quer seja a recolher pagamentos, ir a uma \"reunião\" ou falar com o \"chefe\", qualquer um pode ganhar dinheiro rapidamente e sem ter de bater em ninguém neste videojogo de slots com 25 linhas de jogo e cinco cilindros. Também estão incluídos Jogos de Bónus e prémios de scatter e o símbolo de Mala de Dinheiro é Wild.",
            "sk": "Gangstri sa vrátili a chcú viac! Či už ide o vyberanie platieb, dohováranie alebo stretnutie sa \"šéfom\", ktokoľvek môže v tejto hre s 25 výhernými radmi na piatich valcoch rýchlo zarobiť. Súčasťou hry sú tiež bonusové hry, výhry pomocou symbolov scatter a symboly kufríkov sú zástupné symboly.",
            "ru": "Гангстеры возвращаются за новым кушем! В этой видео слот-игре с 25 выигрышными линиями в пяти барабанах каждый может быстро разбогатеть, независимо от того, занимается ли он сбором платежей, направляется на «отсидку» или встречается с «боссом». Здесь также можно получить призовую игру и выигрыш по разбросанным символам.",
            "zh-hans": "更多黑帮回来了！是不是“商量”，见“老板”还不够，只要有了这个5轴25中奖线的老虎机游戏，任何人不费力气就能成暴发户。奖励游戏和散射可以赢取部分坐骑，并且钱箱符号是万能的。"
