            "pt": "Embarque numa expedição com estes nobres bárbaros escandinavos. O Drunken Vikings tem 5 cilindros giratórios com 15 linhas de jogo. Saboreie uma cerveja gelada durante o divertido Jogo de Bónus e receba Jogadas Grátis com o símbolo Scatter. O Thor é Wild.",
