        "Image": "\/gstatic\/games\/tomhorn\/315\/double_poker.jpg",
        "Url": "987\/VPD",
        "Name": {"en": "Double Poker"},
        "Description": {
            "en": "In Double Poker you are dealt 5 cards and you choose which ones you want hold or replace to complete the highest winning hand possible. Double Poker can be played with a deck of 53 cards, including the joker, or with colored numbers or torpedoes instead. The Joker can substitute for any other card, number or torpedo to complete a winning combination.",
            "cs": "Ve hře Double Poker vám bude rozdáno 5  karet a vy si vyberete, které z nich si chcete nechat a které vyměnit, abyste tak v dané hře dosáhli co nejlepší výherní kombinace. Double Poker lze hrát s balíčkem 53  karet, které obsahují žolíky, nebo s barevnými čísly či torpédy. Žolíkem lze nahradit jakoukoliv jinou kartu, číslo nebo torpédo, abyste tak co nejlépe doplnili výherní kombinaci.",
            "de": "Beim Doppelpoker erhalten Sie 5 Karten und Sie wählen, welche Sie halten oder ersetzen möchten, um die höchstmögliche Gewinnhand zu vervollständigen. Doppelpoker kann mit einem Spiel von 53 Karten, einschließlich Joker, oder mit Farbnummern oder Torpedos gespielt werden. Der Joker kann jede andere Karte, Nummer oder jeden anderen Torpedo ersetzen, um eine Gewinnkombination zu vervollständigen.",
            "es": "En Double Poker le reparten 5 cartas y usted elige cuáles quiere retener o reemplazar para completar la mano ganadora más alta posible. Double Poker se puede jugar con una baraja de 53 cartas (incluyendo el Joker) o con números o torpedos de colores. El Joker puede reemplazar a cualquier otra carta, número o torpedo para ayudar a completar una mano ganadora.",
            "it": "In Double Poker vengono distribuite 5 carte e il giocatore sceglie quali tenere o sostituire per completare la mano con la maggiore vincita possibile. Double Poker si può giocare con un mazzo da 53 carte, incluso il jolly, oppure con numeri colorati o torpedo. Il Jolly può sostituire qualsiasi carta, numero o torpedo per completare una combinazione vincente.",
            "lt": "Žaidime „Double Poker“ jums padalijamos 5 kortos ir jūs renkatės, kurias iš jų norite pasilikti arba pakeisti, kad laimėtumėte didžiausią prizą. „Double Poker“ galima žaisti su 53 kortų malka, įskaitant džiokerį, arba su spalvotais skaičiais ar torpedomis. Džiokeris gali pakeisti bet kurią kitą kortą, skaičių arba torpedą, kad būtų užbaigta pergalinga kombinacija.",
            "hu": "A Dupla Pókerben 5 kártyát osztanak, és Önnek el kell döntenie, hogy mely kártyákat tartja meg, és melyeket cseréli le a lehető legnagyobb nyereményt hozó kombináció kialakításához. A Dupla pókert a jokert tartalmazó 53 lapos kártyapaklival vagy színes-számos és torpedós kártyákkal játsszák. A joker bármely másik kártyát, számot vagy torpedót helyettesíthet a nyerő kombinációban.",
            "pl": "W podwójnym pokerze gracz otrzymuje pięć kart, które można zatrzymać lub wymienić, aby uzyskać wygrywający układ o najwyższej wartości. Podwójny poker może być rozgrywany przy użyciu talii z 53 kartami, włącznie z dżokerem, bądź przy użyciu kolorowych liczb oraz torped. Dżoker może zastąpić dowolną inną kartę, liczbę lub torpedę, aby uzupełnić wygrywający układ.",
            "pt": "No Double Poker, são distribuídas 5 cartas e o jogador escolhe as que pretende manter ou substituir para completar a mão vencedora mais elevada possível. O Double Poker pode ser jogado com um baralho de 53 cartas, incluindo o joker, ou com números coloridos ou torpedos. O Joker pode substituir qualquer outra carta, número ou torpedo, para completar uma combinação premiada.",
            "sk": "V hre Double Poker vám bude rozdaných 5 kariet a vy si vyberiete, ktoré z nich si chcete nechať a ktoré vymeniť, aby ste tak v danej hre dosiahli čo najlepší výherné kombinácie. Double Poker možno hrať s balíčkom 53 kariet, ktoré obsahujú žolíky, alebo s farebnými číslami či torpédami. Žolíkom možno nahradiť akúkoľvek inú kartu, číslo alebo torpédo, aby ste tak čo najlepšie doplnili výhernú kombináciu.",
            "ru": "В двойной покере сдают 5 карт, и необходимо выбрать, какие карты следует оставить, а какие заменить, чтобы собрать самую дорогостоящую комбинацию. В двойной покер можно играть колодой из 53 карт, включая джокера. Вместо них можно использовать цветные цифры или карты «Торпедо». При расчете выигрышной комбинации джокер может заменять любую другую карту, число или торпеду.",
            "zh-hans": "在双倍扑克中，您要处理5张牌，决定那些留下哪些换掉完成最强的组合。双倍扑克可以用一副有小丑的53张牌来玩或者用彩色数字或者鱼雷来代替。小丑可以替换任何牌，数字合作和鱼类来完成中奖组合。"
        },
