        "Name": {"en": "Quick Bingo"},
        "Description": {
            "en": "Choose a bingo card with your lucky numbers on it and quickly match them against the 90 numbers that can be called in this game. The quicker your numbers are matched, the bigger your win will be. The prizes are so attractive that you will truly feel like screaming: BINGO!",
            "cs": "Vyberte si kartu na bingo s vašimi šťastnými čísly a rychle je přiřaďte k  90  číslům, které mohou být v této hře vylosovány. Čím rychleji svá čísla přiřadíte, tím větší odměnu získáte. Ceny jsou tak atraktivní, že se neovládnete a budete mít chuť zakřičet BINGO!",
            "de": "Wählen Sie eine Bingokarte mit Ihren Glückszahlen und stimmen Sie sie rasch mit den 90 Nummern ab, die in diesem Spiel gerufen werden können. Je schneller Ihre Nummer übereinstimmt, umso größer ist Ihr Gewinn. Die Preise sind so attraktiv, dass Sie am liebsten rufen würden: BINGO!",
            "es": "Elige un cartón de bingo con tus números de la suerte y podrás compararlos rápidamente con los 90 números que pueden ser extraídos en la partida. Cuánto más rápido salgan tus números, más ganarás. Los premios son tan llamativos que no podrás contener las ganas de gritar ¡BINGO!",
            "it": "Basta scegliere una carta bingo con i propri numeri fortunati da associare ai rapidamente ai 90 numeri che possono essere estratti in questo gioco. Più è veloce l'associazione dei numeri, maggiore sarà la vincita. I premi sono così attraenti che ti verrà davvero voglia di gridare: BINGO!",
            "lt": "Pasirinkite „bingo“ kortelę su savo laimingais skaičiais ir greitai juos atitaikykite su 90 skaičių, kurie gali iškristi šiame žaidime. Kuo greičiau atitaikomi skaičiai, tuo didesnis laimėjimas. Prizai tokie patrauklūs, kad tikrai norėsite šaukti: BINGO!",
            "hu": "Válasszon egy bingókártyát saját szerencseszámaival, majd gyorsan egyeztesse a játékban kihúzott 90 számmal. Minél gyorsabban egyezteti a számokat, annál nagyobb lesz a nyereménye. A vonzó díjak láttán biztosan úgy fogja érezni, kiáltania kell, hogy BINGÓ!",
            "pl": "Wybierz kartę bingo ze szczęśliwymi liczbami i dopasuj je szybko do 90 liczb, które są wywoływane podczas tej gry. Im szybciej dopasujesz liczby, tym większa będzie wygrana. Nagrody są bardzo atrakcyjne, dlatego szybko nabierzesz ochoty, aby głośno krzyknąć BINGO!",
            "pt": "Escolha um cartão de bingo com os seus números da sorte e compare-os rapidamente com os 90 números que podem sair neste jogo. Quanto mais depressa saírem os seus números, maior será o prémio. Os prémios são tão atrativos que lhe apetecerá gritar: BINGO!",
            "sk": "Vyberte si kartu na bingo s vašimi šťastnými číslami a rýchlo ich priraďte k 90 číslam, ktoré môžu byť v tejto hre vylosované. Čím rýchlejšie svoje čísla priradíte, tým väčšiu odmenu získate. Ceny sú tak atraktívne, že sa neovládne a budete mať chuť zakričať BINGO!",
            "ru": "Выберите карточку со счастливыми числами и быстро сопоставьте их с 90 числами, которые могут называть по ходу этой игры. Чем быстрее будут названы ваши числа, тем больше будет выигрыш. Призы являются столь привлекательными, что действительно можно закричать: БИНГО!",
            "zh-hans": "选择一张带有您幸运数字的宾果卡，然后快速将他们与游戏中出现的90个数字匹配。您的数字越快匹配，您赢的奖励就越大。奖励实在诱人让您忍不住大喊：宾果！"
        },
