        "Image": "\/gstatic\/games\/tomhorn\/315\/european_roulette.jpg",
        "Url": "987\/EURoulette",
        "Name": {"en": "European Roulette"},
        "Description": {
            "en": "European Roulette is the most commonly played version of online roulette. Players, usually up to eight, play against the house represented by the croupier (also called the dealer) who spins the roulette wheel and handles the entries and payouts. The wheel has 37 slots representing 36 numbers and one zero.",
            "cs": "Evropská Ruleta je nejčastěji hraná online ruleta. Hráči, kterých může být až osm, hrají proti kasinu, které reprezentuje krupiér (říká se mu také dealer). Ten roztáčí kolo rulety a zpracovává sázky a výplaty. Kolo je rozděleno na 37  dílů, které představují 36  čísel a jednu nulu.",
            "de": "Europäisches Roulette ist die häufigste Form von Online-Roulette. Die Spieler (normalerweise bis zu 8) spielen gegen das Haus, das durch den Croupier (auch Geber genannt) repräsentiert wird, der das Rouletterad dreht und die Einsätze und Auszahlungen verwaltet. Das Rad hat 37 Slots, die 36 Zahlen und eine Null repräsentieren.",
            "es": "La Ruleta Europea es la versión en línea más común de este juego. Los jugadores, usualmente un máximo de 8, juegan contra la casa representada por un croupier (también conocido como dealer), quien hace girar la ruleta y se encarga de las apuestas y los pagos. La ruleta tiene 37 ranuras, las cuales representan 36 números y un cero.",
            "it": "European Roulette è la versione della roulette online più comunemente giocata. I giocatori, di solito fino a otto, giocano contro la casa rappresentato dal croupier (anche detto banco) che gira la ruota della roulette e gestisce entrate e pagamenti. La ruota ha 37 slot che rappresentano 36 numeri e uno zero.",
            "lt": "„European Roulette“ yra dažiausiai žaidžiama internetinės ruletės versija. Žaidėjai (paprastai iki aštuonių) žaidžia prieš krupjė (taip pat vadinamų dalytoju), kuris suka ruletės ratą ir tvarko statymus bei mokėjimus. Rate yra 37 sritys, kuriose yra 36 skaičiai ir vienas nulis.",
            "hu": "Az Európai Rulett a leggyakrabban játszott online rulettváltozat. A játékosok, akik legfeljebb nyolcan vannak, a ház ellen játszanak, amelyet a krupié (más néven dealer) képvisel. A krupié pörgeti a rulettkereket, kezeli a tételeket és a nyereményeket. A keréken 37 osztás van, 36 szám és egy nulla.",
            "pl": "Europejska ruletka to najpopularniejsza wersja ruletki online. Gracze — zwykle do ośmiu — grają przeciwko kasynu reprezentowanemu przez krupiera, który obraca kołem ruletki oraz obsługuje zakłady i wypłaty. Koło ma 37 przedziałów przedstawiających 36 liczb i jedno zero.",
            "pt": "A Roleta Europeia é a versão mais jogada da roleta online. Até oito jogadores jogam contra a casa, representada pelo crupiê (também chamado de dealer), que faz girar a roleta e gere as apostas e os pagamentos. A roleta tem 37 espaços que representam 36 números e um zero.",
            "sk": "Európska Ruleta je najčastejšie hraná online ruleta. Hráči, ktorých môže byť až osem, hrajú proti kasínu, ktoré reprezentuje krupiér (hovorí sa mu tiež dealer). Ten roztáča koleso rulety a spracováva stávky a výplaty. Kolo je rozdelené na 37 dielov, ktoré predstavujú 36 čísel a jednu nulu.",
            "ru": "Европейская рулетка является наиболее популярной версией интерактивной рулетки. Игроки, обычно не более восьми, играют против казино в лице крупье (также его называют дилером), который вращает колесо рулетки, выдает выигрыши и забирает проигранные ставки. На колесе имеется 37 ячеек с 36 цифрами и одной ячейкой зеро.",
            "zh-hans": "欧洲轮盘赌和一般版本类似。玩家一般最多8个，和代表赌场的总管(也叫庄家)对抗，转动轮盘，处理赌注和支出。轮盘有37插槽，其中一个为零。"
        },
