        "Url": "987\/VSlotWOF",
        "Name": {"en": "Wheel Of Luck"},
        "Description": {
            "en": "Spin the Wheel of Luck and prepare for high winnings and bonuses. Wheel of Luck has 5 spinning reels with 25 win lines. The game includes a special extra Bonus feature. The Wheel of Luck symbol is Wild and can substitute for other symbols, except Scatter, to complete more winning combinations.",
            "cs": "Roztočte kolo štěstí a připravte se na vysoké výhry a  bonusy. Hra Wheel of Luck má 5  válců a  25  výherních řad. Ve hře na vás čekají zvláštní bonusy. Symbol kola štěstí je zástupný a  může zastupovat jakýkoliv jiný symbol kromě symbolu scatter, aby vám tak pomohl vytvořit co nejlepší výherní kombinace.",
            "de": "Drehen Sie am Glücksrad und machen Sie sich bereit für hohe Gewinne und Bonus-Zahlungen. „Glücksrad“ hat 5 Walzen mit 25 Gewinnzeilen. Das Spiel beinhaltet eine spezielle Extra-Bonus-Funktion. Das Glücksrad ist ein Wild-Symbol und kann andere Symbole ersetzen, außer Scatter, um mehr Gewinnkombinationen zu vervollständigen.",
            "es": "Haz girar la Rueda de la Suerte y prepárate para recibir grandes ganancias y bonos. Wheel of Luck tiene 5 carretes y 25 líneas de pago. El juego incluye una funcionalidad de  Bono extra. El símbolo Wheel of Luck es Wild, lo que significa que puede sustituir a cualquier otro símbolo, excepto el Scatter, para completar más combinaciones ganadoras.",
            "it": "Gira la ruota della fortuna e preparati a ricche vincite e bonus. Wheel of Luck ha 5 rulli rotanti su 25 linee di vincita. Il gioco include un'opzione di Bonus extra speciale. Il simbolo della ruota della fortuna è un simbolo Wild e può sostituire gli altri simboli, tranne il simbolo Scatter, per completare un numero maggiore di combinazioni vincenti.",
            "lt": "Sukite laimės ratą ir pasiruoškite laimėti daug prizų bei premijų. Žaidime „Wheel of Luck“ yra 5 suktuvai su 25 laimėjimo linijomis. Žaidime yra speciali papildoma BONUS galimybė. Laimės rato paveikslėlis yra WILD simbolis, kuris gali pakeisti kitus simbolius, išskyrus SCATTER, kad būtų užbaigtos pergalingos kombinacijos.",
            "hu": "Pörgesse meg a Szerencsekereket, és készüljön fel a nagy értékű nyereményre és bónuszokra. A Szerencsekeréknek 5 forgó tárcsája és 25 nyerősora van. A játék része egy speciális extra bónusz funkció. A szerencsekerék szimbólum joker, amely a scatter kivételével más szimbólumokat helyettesíthet, hogy több nyerő kombinációt érjen el.",
            "pl": "Zakręć kołem fortuny i przygotuj się na wysokie wygrane i premie. Gra Wheel of Luck ma pięć obracających się bębnów i 25 linii wygranej. W grze można znaleźć także specjalną funkcję dodatkowej premii. Symbol koła fortuny jest wieloznaczny i zastępuje dowolny inny symbol (z wyjątkiem rozproszonego symbolu) w wygrywających układach.",
            "pt": "Rode a  roda da sorte e prepare-se para grandes prémios e bónus. A Wheel of Luck tem 5 cilindros giratórios e 25 linhas de jogo. O jogo inclui uma atração de Bónus extra. O símbolo de Roda da Sorte é Wild e pode substituir outros símbolos, exceto Scatter, para completar mais combinações premiadas.",
            "sk": "Roztočte koleso šťastia a pripravte sa na vysoké výhry a bonusy. Hra Wheel of Luck má 5 valcov a 25 výherných radov. V hre na vás čakajú zvláštne bonusy. Symbol kolesá šťastie je zástupný a môže zastupovať akýkoľvek iný symbol okrem symbolu scatter, aby vám tak pomohol vytvoriť čo najlepší výherné kombinácie.",
            "ru": "Раскрутите «колесо фортуны» и приготовьтесь к крупным выигрышам и бонусам. В игре «Колесо Фортуны» имеется 5 вращающихся барабанов с 25 выигрышными линиями. В игре также имеется специальный дополнительный бонус. Символ колеса фортуны является «диким» и может заменять другие символы, кроме \"разбросанного символа» для получения дополнительных выигрышных комбинаций.",
            "zh-hans": "转动幸运之轮等着赢钱吧。幸运之轮有5转轮25嬴奖线。游戏包含一个特别的额外奖励功能。幸运之轮符号是万能的，可以代替其他任何符号， 除了散射，来完成您的嬴奖组合。"
        },
