        "Url": "987\/VSlotWN",
        "Name": {"en": "Wild Sierra"},
        "Description": {
            "en": "Feed your wild instincts and win the big prizes contained in this game. There are 20 symbols on the screen and 40 win lines over its 5 reels. The Wild Sierra symbol is also a wild card and the Tree of Life has the amazing ability of awarding you Free Spins. Click and roar with every win!",
            "cs": "Uspokojte svůj instinkt a vyhrajte hodnotné ceny, které na vás v této hře čekají. Na obrazovce se zobrazuje 20  symbolů a  na 5  válcích je celkem 40 výherních řad. Symbol Divoké Pohoří je zároveň také zástupný symbol a strom života má zase tu úžasnou schopnost vás odměnit zatočeními zdarma. Klikejte a radujte se z  každé výhry!",
            "de": "Füttern Sie Ihre wilden Instinkte und gewinnen Sie die großen Preise dieses Spiels. Es gibt 20 Symbole auf dem Bildschirm und 40 Gewinnzeilen auf seinen 5 Walzen. Das „Wild Sierra“-Symbol ist ebenfalls eine Wild-Karte und der „Lebensbaum“ hat die wunderbare Fähigkeit, Sie mir Gratis-Spins zu belohnen. Klicken Sie und jubeln Sie mit jedem Gewinn!",
            "es": "Alimenta tu instinto animal y gánate los grandes premios que contiene este juego. Son 20 los símbolos en la pantalla y 40 las líneas de pago sobre sus 5 carretes. El símbolo Sierra Salvaje es un comodín y el Árbol de la Vida tiene la extraordinaria habilidad de conferir Jugadas Gratis. ¡Haz click y ruge con cada victoria!",
            "it": "Segui i tuoi istinti e vinci i ricchi premi contenuti in questo gioco. Ci sono 20 simboli sullo schermo e 40 linee di vincita su 5 rulli. Il simbolo della Sierra Selvaggia è anche una carta Wild e l'albero della vita può farti vincere Partite Libere. Clicca e urla ad ogni vincita!",
            "lt": "Patenkinkite savo laukinius instinktus ir laimėkite didelių prizų, esančių šiame žaidime. Yra 20 simbolių ekrane ir 40 laimėjimo linijų 5 suktuvuose. Laukinė aukštuma paveikslėlis yra WILD simbolis, o Gyvybės medis turi įspūdingą galimybę apdovanoti jus nemokamais sukimais. Spauskite ir džiaukitės kiekviena pergale!",
            "hu": "Táplálja ősi ösztöneit, és nyerje meg a játékban elérhető nagy nyereményeket. A képernyőn 20 szimbólum van, és 40 nyerősor helyezkedik el 5 tárcsán. A vadon szimbólum joker is, az élet fája pedig lenyűgöző módon képes ingyenes pörgetésekkel megajándékozni Önt. Kattintson és bődüljön el minden nyereménynél!",
            "pl": "Uwolnij swoje dzikie instynkty i wygrywaj ogromne nagrody w tej grze. Na ekranie jest wyświetlanych 20 symboli. Gra ma pięć bębnów i 40 linii wygranej. Symbol Dzika Sierra jest także dziką kartą, a symbol drzewa życia ma niesamowitą możliwość nagrodzenia darmowymi spinami. Klikaj i krzycz przy każdej wygranej.",
            "pt": "Siga os seus instintos selvagens e ganhe grandes prémios neste jogo. Existem 20 símbolos no ecrã e 40 linhas de jogo nos 5 cilindros. O símbolo de Serra Selvagem também é Wild e a Árvore da Vida tem o fantástico poder de atribuir Jogadas Grátis. Clique e emita um rugido com cada prémio!",
            "sk": "Uspokojte svoj ​​inštinkt a vyhrajte hodnotné ceny, ktoré na vás v tejto hre čakajú. Na obrazovke sa zobrazuje 20 symbolov a na 5 valcoch je celkom 40 výherných radov. Symbol Divoké Pohorie je zároveň tiež zástupný symbol a strom života má zase tú úžasnú schopnosť vás odmeniť zatočením zadarmo. Klikajte a radujte sa z každej výhry!",
            "ru": "Дайте волю своим диким инстинктам и выиграйте крупные призы, которые имеются в этой игре. На экране имеется 20 символов 40 выигрышных линий на 5 барабанах. Символ «Дикая Сьерра» также является «диким», а «Древо жизни» обладает удивительной способностью дарить бесплатные обороты. Щелкните и торжествуйте каждую победу!",
            "zh-hans": "遵从您的野生本能，在这个游戏里赢个大奖。画面上有20个符号，5轴40中奖线，狂野塞拉是一个万能符号也有生命之树的能力，可以给您自由旋转。点击咆哮每一次赢奖吧！"
        },
