        "Url": "987\/EKeno",
        "Name": {"en": "Extra Keno"},
        "Description": {
            "en": "Extra Keno gives you the chance to triple your winnings with the last ball drawn, which adds extra balls to the game. Extra Keno uses playing spots and a number pot with numbers from 1 to 80. In every round 20 numbers are drawn.",
            "cs": "Hra Extra Keno vám přináší možnost po posledním taženém míčku ztrojnásobit svou výhru, což celé hře dodá na intenzitě. Hra Extra Keno používá hrací pole a losovací osudí s čísly od  1  do 80. V každém kole je taženo 20  čísel.",
            "de": "Extra Keno bietet Ihnen die Chance, Ihre Gewinne mit der letzten gezogenen Kugel zu verdreifachen, wodurch zusätzliche Kugeln zum Spiel hinzugefügt werden. Extra Keno verwendet Spielspots und einen Nummerntopf von 1 bis 80. In jeder Runde werden 20 Nummern gezogen.",
            "es": "Extra Keno te da la oportunidad de triplicar tus ganancias con la última bola extraída, la cual añade bolas extra al juego. Extra Keno se juega con números del 1 al 80. En cada partida se extraen 20 números.",
            "it": "Extra Keno consente di triplicare le vincite con l'ultima pallina estratta, che aggiunge palline extra al gioco. Extra Keno utilizza schede di gioco e un bussolotto contenente i numeri da 1 a 80. Ad ogni giro vengono estratti 20 numeri.",
            "lt": "„Extra Keno“ suteikia šansą patrigubinti laimėjimą traukiant paskutinį kamuoliuką, kuris prideda papildomų kamuoliukų žaidime. Žaidime „Extra Keno“ naudojamos žaidimo sritys ir skaičių indas, kuriame yra skaičiai nuo 1 iki 80. Kiekvienu etapu traukiama 20 skaičių.",
            "hu": "Az Extra Kenóval akár háromszoros nyereményt is elérhet az utolsó húzásnál, amely extra golyókat hoz a játékba. Az Extra kenóban játékmezők vannak, a számkosár 1–80-ig tartalmazza a számokat. Minden körben 20 számot húznak.",
            "pl": "Extra Keno zapewnia szansę potrojenia wygranej po wylosowaniu ostatniej kuli, która powoduje dodanie dodatkowych kul do gry. Gra Extra Keno wykorzystuje przedziały i obszar z liczbami od 1 do 80. W każdej rundzie jest losowanych 20 liczb.",
            "pt": "O Extra Keno possibilita-lhe triplicar os seus prémios com a última bola lançada, que adiciona bolas extra ao jogo. O Extra Keno utiliza lugares de jogo e um pote de números de 1 a 80. São extraídos 20 números em cada jogo.",
            "sk": "Hra Extra Keno vám prináša možnosť po poslednom ťahanom loptičke strojnásobiť svoju výhru, čo celej hre dodá na intenzite. Hra Extra Keno používa hracie pole a losovacej osudia s číslami od 1 do 80. V každom kole je ťahané 20 čísiel.",
            "ru": "Extra Keno дает возможность утроить выигрыш при розыгрыше последнего шара. При этом в игру добавляются дополнительные шары. В Extra Keno используются играющие ячейки и числовая панель с числами от 1 до 80. В каждом раунде разыгрывается 20 чисел.",
            "zh-hans": "额外基诺给您机会用最后一球三倍奖金。额外基诺使用游戏点和一个有从1-80数字的数字底池，每回合绘制出20个数字。"
        },
